import React from 'react';
import JSpdf from 'jspdf';
import 'jspdf-autotable';


class PDFfile extends React.Component {
  addAllItemsTogether(nutritionName) {
    let valueNutrition = 0;
    this.props.myNutritionList.forEach((singleFood) => {
      if (nutritionName === 'weight') {
        valueNutrition += Number(singleFood.weight);
      } else {
        valueNutrition += singleFood.nutrition[nutritionName].value;
      }
    });
    return valueNutrition;
  }

  demoFromHTML() {
    /* eslint-disable */
    const imgUrl = `data:image/png;base64,
    
    
    `;
    /* eslint-enable */
    const columns = [
      { title: 'Food', dataKey: 'food' },
      { title: 'Weight', dataKey: 'weight' },
      { title: 'Kcal', dataKey: 'kcal' },
      { title: 'Protein', dataKey: 'protein' },
      { title: 'Carbs', dataKey: 'carbs' },
      { title: 'Fat', dataKey: 'fat' },
    ];

    const rows = this.props.myNutritionList.map(e =>
      ({
        food: e.name,
        weight: `${e.weight}g`,
        kcal: e.nutrition[0].value,
        protein: `${e.nutrition[1].value}g`,
        carbs: `${e.nutrition[3].value}g`,
        fat: `${e.nutrition[2].value}g`,
      }));

    const options = {
      styles: { fillColor: [200, 200, 150], overflow: 'linebreak', valign: 'middle' },
      columnStyles: {
        food: { columnWidth: 270 },
        weight: { columnWidth: 50, halign: 'center' },
        kcal: { columnWidth: 40, halign: 'center' },
        protein: { columnWidth: 52, halign: 'center' },
        carbs: { columnWidth: 50, halign: 'center' },
        fat: { columnWidth: 50, halign: 'center' },
        cellPadding: 3,
        fontSize: 15,
        cellHeight: 50,
      },
      headerStyles: {
        fillColor: [44, 62, 80],
        fontSize: 12,
        columnWidth: 75,
      },
      margin: {
        top: 200 } };
    const date = new Date();

    // PDF content
    const doc = new JSpdf('p', 'pt');
    doc.setFontSize(40);
    doc.addImage(imgUrl, 'JPEG', 295, 59);
    doc.text('M-Nutritioner', 180, 125);

    doc.setFontSize(10);
    doc.text(`${date.getDate()}/${date.getMonth()}/${date.getFullYear()}`, 20, 20);
    doc.text('https://github.com/Libikk', 20, 827);
    doc.text('Page 1 / 1', 285, 805);
    doc.autoTable(columns, rows, options);

    doc.setFontStyle('bold');
    doc.setFontSize(18);
    doc.text('Summary', 40, doc.autoTable.previous.finalY + 30);
    doc.setFontSize(14);
    doc.text(`${this.addAllItemsTogether('weight')}g`, 323, doc.autoTable.previous.finalY + 30);
    doc.setFontSize(14);
    doc.text(`${this.addAllItemsTogether(0)}`, 369, doc.autoTable.previous.finalY + 30);
    doc.setFontSize(14);
    doc.text(`${this.addAllItemsTogether(2)}g`, 419, doc.autoTable.previous.finalY + 30);
    doc.setFontSize(14);
    doc.text(`${this.addAllItemsTogether(3)}g`, 473, doc.autoTable.previous.finalY + 30);
    doc.setFontSize(14);
    doc.text(`${this.addAllItemsTogether(1)}g`, 518, doc.autoTable.previous.finalY + 30);

    doc.save('table.pdf');
  }

  render() {
    return (
      <div>
        <img className="pdf-icon" src="./src/js/images/pdfIcon.png" onClick={() => this.demoFromHTML()} alt="PDF download" />
      </div>
    );
  }
}

export default PDFfile;
